import React from "react";

import TitleBasic from "../../components/man/as/TitleBasic";
import MiddleBoxAs from "../../components/man/as/MiddleBoxAs";

import ManTalkImg from "../../assets/man/talk_navy.png";

const TalkPage = () => {
  return (
    <div className="allas">
      <div className="topas">
        <TitleBasic imgSrc={ManTalkImg} title="견적 및 문의서 관리" />
      </div>

      <div className="middleas"></div>

      <div className="bottomas"></div>
    </div>
  );
};

export default TalkPage;
